import React from 'react'
import '../App.css'
import {
  Navbar,
  Nav,
  NavItem,
  Container,
  Dropdown,
  DropdownButton,
  Button,
} from 'react-bootstrap'
import { LinkContainer } from 'react-router-bootstrap'

class Header extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      isLogged: false,
    }
  }
	onChange = () => {
		this.setState({
			isLogged: !this.state.isLogged
		})
		console.log(this.state.status)
	}
  render() {
    return (
      <>
        <div className="header-line-wrapper">
          <header className="header-wrapper fixed-top plr100">
            <div id="header" className="main-menu">
              <Navbar collapseOnSelect expand="lg" className="navbar-dark">

			   <button onClick={this.onChange} style={{marginLeft: '400px'}} type="button" className="ml-5 btn btn-danger">{this.props.status ? 'Click Me' : 'Hello Admin'}</button>

              </Navbar>
            </div>
          </header>
        </div>
      </>
    )
  }
}

export default Header
